public boolean equals(Object o) {
  if (this == o) return true;
  if (!(o instanceof SwiftObjectPath)) return false;
  final SwiftObjectPath that = (SwiftObjectPath) o;
  return this.toUriPath().equals(that.toUriPath());
}
